import React from 'react';
import '../styles/Hockey.css';

const Football = () => {
  return (
    <div className="hockey-container">
    <h1>FOOTBALL</h1>
      <h2>Welcome to Football at Kilifi Sports Hub!</h2>
      <p>Football is one of the main attractions at Kilifi Sports Hub, with several teams competing in local leagues and tournaments. The hub hosts regular matches and training sessions for players of all ages and skill levels.</p>
      <p>Teams at Kilifi Sports Hub often participate in community events and friendly matches with neighboring clubs, fostering a sense of camaraderie and sportsmanship. Experienced coaches are available to provide guidance and training to aspiring footballers, helping them develop their skills on and off the field.</p>
    </div>
  );
}

export default Football;
